import "./App.css";

function App() {
  const name = "Harshal Rajendra Sonawane";
  const liker = 50;
  const link = "http://www.google.com";
  //const obj = { name: harshal };
  return (
    <div className="App">
      <div className="content"></div>
      <h1>{name}</h1>
      <p>Harshal likes {liker} times.</p>
      <p>{[1, 2, 3, 4, 5]}</p>
      <p>{10}</p>
      <p>{Math.random() * 10}</p>
      <a href={link}>Google site</a>
    </div>
  );
}

export default App;
